var numberOfProducts = ["1", "2", "3", "4"];

function App() {
  return (
    <div className="App">
        <Banner bannerName= "Raide Energy"/>
        {numberOfProducts.map(item => {<Product productName={item}/>})}
        <Product productName="Product 1"/>
    </div>
  );
}

export default App;
